import React from "react";
import "../assets/css/Search.css";

export default function Search() {
    return (
        <div className='search-wrapper'>
            <div className='filter'>
                <select className='select-category'>
                    <option>1</option>
                    <option>2</option>
                    <option>3</option>
                    <option>4</option>
                </select>
            </div>
            <div className='item-wrapper'></div>
        </div>
    );
}
